"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[1477],{10:a=>{a.exports=JSON.parse('{"blogPosts":[{"id":"Versi 3.0.0","metadata":{"permalink":"/blog/2021/09/30/versi-300","source":"@site/blog/2021-09-30-versi-300.md","title":"Versi 3.0.0","description":"Improvisasi terhadap codebase terutama fitur Showtimes","date":"2021-09-30T00:00:00.000Z","formattedDate":"September 30, 2021","tags":[],"readingTime":0.475,"truncated":true,"authors":[{"name":"N4O","url":"https://github.com/noaione","imageURL":"/img/author/noaione.png"}],"nextItem":{"title":"Verified \u2705","permalink":"/blog/2021/06/26/verified"}},"content":"![ntui Splash](/assets/img/naotimes_v3.png)\\n\\nVersi 3.0.0 sudah dirilis dan dapat anda rasakan langsung!\\n\\n\x3c!--truncate--\x3e\\n\\nSetelah sekian lama saya develop versi 3.0.0 ini secara internal (dan sendiri!), akhirnya saya bisa merilis versi baru ini.\\n\\nTerima kasih bagi semuanya yang sudah mengsupport naoTimes dan menggunakannya!\\n\\nBerikut adalah orang yang membantu development (termasuk saran):\\n- XCR90 (Tukang nemu bug)\\n- Kresendo (Bantuan lokalisasi fitur, sugesti fitur)\\n\\nDan berikut adalah kalian yang donasi selama development v3:\\n- Zulfikar Akbar (Rp32500)\\n- Rene (Rp2500)\\n- Anonim (Rp2500)\\n- Anonim 2 (Rp50000)\\n- Rangga (Rp10000)\\n- Pawang Hiu (5$)\\n- fthyll (Rp25000)\\n  \\n\ud83e\udd73"},{"id":"Verified \u2705","metadata":{"permalink":"/blog/2021/06/26/verified","source":"@site/blog/2021-06-26-verified.md","title":"Verified \u2705","description":"Setelah sekian lama sejak Bot ini dibuat, akhirnya Bot ini telah diverifikasi oleh Discord.","date":"2021-06-26T00:00:00.000Z","formattedDate":"June 26, 2021","tags":[],"readingTime":0.46,"truncated":true,"authors":[{"name":"N4O","url":"https://github.com/noaione","imageURL":"/img/author/noaione.png"}],"prevItem":{"title":"Versi 3.0.0","permalink":"/blog/2021/09/30/versi-300"},"nextItem":{"title":"naoTimes WebUI","permalink":"/blog/2021/04/04/naotimes-ui"}},"content":"![Verified!](/assets/img/verified_thumb.png)\\n\\n*naoTimes sekarang terverifikasi!*\\n\\n\x3c!--truncate--\x3e\\n\\nBot ini telah melalui perjalanan lama sebelum akhirnya tiba di versi sekarang.\\n\\nSekitar 1 bulan yang lalu, tepatnya 27 Mei saya dapet email bahwa Bot naoTimes sudah mencapai 75 peladen dan bisa melakukan proses verifikasi. Pada saat itu juga saya submit aplikasi untuk melakukan proses Verifikasi.\\n\\nSekitar beberapa jam lalu setelah saya menulis artikel ini, aplikasi verifikasi Bot naoTimes diterima dan sekarang Bot memiliki tanda centang \ud83d\ude0e.\\n\\n---\\n\\nTerima kasih pada semuanya yang sudah memakai bot naoTimes dan terus mendukung! ~~Jangan lupa donasinya kakak~~~\\n\\nSalam,<br />\\nN4O"},{"id":"naoTimes WebUI","metadata":{"permalink":"/blog/2021/04/04/naotimes-ui","source":"@site/blog/2021-04-04-naotimes-ui.md","title":"naoTimes WebUI","description":"Sebuah website untuk mengatur Garapan di Bot naoTimes melalu browser anda","date":"2021-04-04T00:00:00.000Z","formattedDate":"April 4, 2021","tags":[],"readingTime":0.49,"truncated":true,"authors":[{"name":"N4O","url":"https://github.com/noaione","imageURL":"/img/author/noaione.png"}],"prevItem":{"title":"Verified \u2705","permalink":"/blog/2021/06/26/verified"},"nextItem":{"title":"Halo Dunia","permalink":"/blog/2021/04/03/halo-dunia"}},"content":"![ntui Splash](/assets/img/ntui_img.png)\\n\\nnaoTimes mendapatkan fitur baru!\\n\\n\x3c!--truncate--\x3e\\n\\nHalo-halo, N4O di sini. Fitur ini mulai dibuat karena saya sendiri mulai tertarik untuk mencoba Framework Frontend pada JavaScript.\\n\\nFramework yang tak pakai sendiri berubah beberapa kali, dari SvelteKit, ke Next.js, dan akhirnya menyerah dan menggunakan Express.js + EJS dan melakukan rendering secara Server-side.\\n\\nDiprakasai dengan TailwindCSS untuk styling, akhirnya bisa ngebuat design website yang lumayan bagus untuk Dashboard.\\n\\nnaoTimesUI dapat diakses di sini: https://panel.naoti.me/\\n\\nDengan merilis naoTimesUI, semua orang bisa daftar melalui website dan melakukan berbagai macam hal di Website, info lebih lanjut dapat dilihat di sini: [Integrasi naoTimes UI](/docs/integrasi/naotimesui)"},{"id":"Halo Dunia","metadata":{"permalink":"/blog/2021/04/03/halo-dunia","source":"@site/blog/2021-04-03-halo-dunia.md","title":"Halo Dunia","description":"Rumah baru untuk dokumentasi naoTimes","date":"2021-04-03T00:00:00.000Z","formattedDate":"April 3, 2021","tags":[],"readingTime":0.625,"truncated":true,"authors":[{"name":"N4O","url":"https://github.com/noaione","imageURL":"/img/author/noaione.png"}],"prevItem":{"title":"naoTimes WebUI","permalink":"/blog/2021/04/04/naotimes-ui"}},"content":"Setelah sekian lama memakai docsify sebagai halaman dokumentasi dari Bot ini, akhirnya naoTimes pindah ke rumah baru yaitu [Docusaurus](https://docusaurus.io/).\\n\\n\x3c!--truncate--\x3e\\n\\nWebsite sekarang lebih enak diliat, dan gak perlu reload kalo misalkan ada update baru gegara worker yang ngebuat website lama kadang enggak mau ngeupdate dengan konten baru.\\n\\nWaktu itu juga gak terlalu nemu alternatif yang bagus, akhirnya pakai itu untuk website sementara.\\n\\n## Kenapa pindah?\\nGak kenapa-napa, Docusaurus sendiri sebenernya lebih berat karena pake React, tapi ngeliat-ngeliat sih lebih enak aja pake ini.\\n\\nPlus, ada bonus blog :)\\n\\n## Penutup\\n\\nGak mau panjang-panjang, yang pasti sekarang dokumentasi telah dipindah ke sini, dan semua informasi terbaru akan diusahakan dibuat blog postnya.\\n\\n![Have a nice day (and have a smiling Towa)](https://p.ihateani.me/xtjfskwl.png)\\n###### Have a very cute angel"}]}')}}]);